(3, 'uploads/short_image/2020/09/02/DI1xaX7y2UtNCzYODjAxO7Nd7DhUoJGsbVKFdqrW.jpeg', 'uploads/short_image/2020/09/02/DI1xaX7y2UtNCzYODjAxO7Nd7DhUoJGsbVKFdqrW.jpeg', '<p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:12.0pt;font-family:&quot;Helvetica&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica\"><b><u>What safety measures has Anaz taken to make sure packages are not infected?</u></b><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\r\n&quot;Helvetica&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\nHelvetica\">Our DEX heroes - delivery agents and operations team have been\r\ninstructed to wear protective gear including gloves and masks while delivering.\r\nWe have also shared the same guidelines with our Logistics Partners for order\r\ndeliveries. We are also making sure that packages are disinfected at customers\'\r\ndoorstep wherever possible.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:12.0pt;font-family:&quot;Helvetica&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica\">How to return your product?<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\r\n&quot;Helvetica&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\nHelvetica\">Please find below steps to know how to fill ORF and return related\r\nprocedure:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\r\n&quot;Helvetica&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\nHelvetica\">1. Sign in to your Anaz Account, select My Orders.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\r\n&quot;Helvetica&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\nHelvetica\">2. Select the order you wish to return and click on the Manage Order\r\nbutton.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\r\n&quot;Helvetica&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\nHelvetica\">3. Click on Return Items.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\r\n&quot;Helvetica&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\nHelvetica\">4. Fill in the Return Form. The available return options\r\n(drop-off/pick-up) will be displayed in this form.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\r\n&quot;Helvetica&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\nHelvetica\">5. Pack your Anaz parcel securely, with the product in the original\r\nand undamaged manufacturer\'s packaging as delivered to you and print the Return\r\nLabel.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\r\n&quot;Helvetica&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\nHelvetica\">If you are from inside Dhaka then print 1 copy of the return label\r\n&amp; secure the copy on the top of Anaz box &amp; if you are from outside\r\nDhaka then print 2 copies of the return label and stick 1 copy on the top of Anaz box and also give a copy inside the Anaz box too.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\r\n&quot;Helvetica&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\nHelvetica\">6. If you selected Pick-up then you will be contacted within 72\r\nhours of the return request. If you selected Drop off then you can drop it to\r\nyour nearest drop off point within 3 working days from the return request.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\r\n&quot;Helvetica&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\nHelvetica\">If you do not get any drop off point from your area then you need to\r\nreturn that item via Sundarban Courier Service as per below address:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\r\n&quot;Helvetica&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\nHelvetica\">Ref:DBR00008931<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\r\n&quot;Helvetica&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\nHelvetica\">To: Anaz Bangladesh (Anazbd.com)<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\r\n&quot;Helvetica&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\nHelvetica\">Receiver Number: +8801958389013<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\r\n&quot;Helvetica&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\nHelvetica\">Address: 131, Uttor Begun Bari Road, Tejgaon Industrial Area,\r\nDhaka-1208<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\r\n&quot;Helvetica&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\nHelvetica\">NOTE: As, the situation in our country is not stable due to the\r\nCOVID-19. So you might experience delays in the return process. We seek your\r\ncooperation for the inconvenience and we are trying our best to process the\r\nreturn as soon as possible. Stay home and be safe.<o:p></o:p></span></p>', 1, '2020-08-26 19:48:47', '2020-09-02 19:39:14', 1, 'Customer Care', 'customer-care');
