(53, 9, 16, 27, 10, 'Lifebuoy Handwash Total Pump 200ml', 'lifebuoy-handwash-total-pump-200ml-jkpkpj', 'uploads/product-feature/2020/09/02/2JcMneX9adg0w0axlQPmG2M5OnF5nZugZgk8hoXn.jpeg', '2020-09-02 07:07:18', '2020-09-25 02:08:03', 7, 44, NULL, NULL, NULL, NULL, NULL, '<p>Unilever is a Dutch-British transnational consumer goods company co-headquartered in Rotterdam, Netherlands and London, United Kingdom. Its products include food, beverages, cleaning agents and personal care products. It is the world\'s largest consumer goods company measured by 2012 revenue, Unilever is the world\'s largest producer of food spreads, such as margarine. Unilever is one of the oldest multinational companies; its products are available in around 190 countries.<br>&nbsp;</p>', 'uploads/product-feature-rsz/2020/09/02/2JcMneX9adg0w0axlQPmG2M5OnF5nZugZgk8hoXn.jpeg', 'uploads/product-feature-thumb/2020/09/02/2JcMneX9adg0w0axlQPmG2M5OnF5nZugZgk8hoXn.jpeg', 'Lifebuoy Handwash Total Pump 200ml', NULL, 1, 3, 4, NULL, 1, 1),
(59, 9, 3, 54, 14, 'QCY T6 True Wireless Bluetooth in-Ear Headset', 'qcy-t6-true-wireless-bluetooth-in-ear-headset-4g5g3g', 'uploads/product-feature/2020/09/02/ZMaTc3HWPh7ip7ccGpXMHrBd6ZRcSLk6G98PiD2t.jpeg', '2020-09-02 15:30:17', '2020-09-29 20:20:22', 11, 42, NULL, NULL, NULL, NULL, NULL, '<ul><li>Model: QCY-T6</li><li>1 Month Official Warranty</li><li>Bluetooth version: V5.0</li><li>Bluetooth distance: 10M</li><li>Talk time: 5.5H</li><li>Battery capacity of charging box: 600mAh</li><li>Style: Ear hook</li><li>Communication mode: wireless</li><li>Connector: USB</li><li>Wireless Type: Bluetooth</li><li>Principles of Vocal Music: Dynamic</li><li>Control Button: Yes</li><li>Volume Control: Yes</li><li>Active Noise Cancellation: Yes</li><li>Function: Exercise</li><li>Plug Type: Wireless</li><li>Sensitivity: 120dB</li><li>Frequency response range: 20-20000Hz</li><li>Line Length: None</li><li>Resistor: 32</li><li>Waterproof: Yes</li><li>Model: T6</li><li>Apt-x support: Yes</li><li>Memory card support: No</li><li>Support APP: Yes</li><li>Wireless: Yes</li><li>With microphone: Yes</li></ul>', 'uploads/product-feature-rsz/2020/09/02/ZMaTc3HWPh7ip7ccGpXMHrBd6ZRcSLk6G98PiD2t.jpeg', 'uploads/product-feature-thumb/2020/09/02/ZMaTc3HWPh7ip7ccGpXMHrBd6ZRcSLk6G98PiD2t.jpeg', 'QCY T6 True Wireless Bluetooth in-Ear Headset Waterproof Sports Earplugs Dual Microphone Call Noise Reduction Low Latency Game Mode for Android iOS', NULL, 0, 2, 2, NULL, 0, 0),
(128, 11, 16, 49, 1, 'Tong Garden Fresh Roasted Salted Pistachios-1kg', 'tong-garden-fresh-roasted-salted-pistachios-1kg-kjobwn', 'uploads/product-feature/2020/09/03/d2T05aBLpiHNGJZo22nLAFsujbtF8mKGwPw7NTLF.jpeg', '2020-09-03 20:20:16', '2020-09-29 20:17:54', 11, 52, NULL, NULL, NULL, NULL, NULL, '<p>Tong Garden Salted Pistachios are made with only 100% natural opened California grown pistachios. There is absolutely no bleaching or preservatives and these superior quality nuts are packed with natural nutrition. Pistachios are an excellent source of dietary fibre, vegetable protein and energy, contain no cholesterol and are low in saturated fat.</p>', 'uploads/product-feature-rsz/2020/09/03/d2T05aBLpiHNGJZo22nLAFsujbtF8mKGwPw7NTLF.jpeg', 'uploads/product-feature-thumb/2020/09/03/d2T05aBLpiHNGJZo22nLAFsujbtF8mKGwPw7NTLF.jpeg', 'tong Garden Fresh Roasted Salted Pistachios-1kg', NULL, 0, 3, 2, 2, 0, 0),
(191, 9, 5, 89, 2, 'Wet n Wild Color Icon Eyeshadow 10 Pan Palette- Cosmic Collision', 'wet-n-wild-color-icon-eyeshadow-10-pan-palette-cosmic-collision-qy4w6r', 'uploads/product-feature/2020/09/05/4FJxoW83SQGLa4aFsRFysBnWVBsypQNMXMRp7K7w.jpeg', '2020-09-05 20:31:18', '2020-09-27 17:31:24', 11, 8, 22, NULL, NULL, NULL, NULL, '<ul><li>10 pan eyeshadow palette with matte transition and gorgeous shimmer shades</li><li>Highly pigmented formula glides on effortlessly with minimum fallout</li><li>Easy to blend formula can be used wet or dry</li><li>This product is gluten-free, fragrance-free and cruelty-free</li><li>Available in 4 different variants</li></ul>', 'uploads/product-feature-rsz/2020/09/05/4FJxoW83SQGLa4aFsRFysBnWVBsypQNMXMRp7K7w.jpeg', 'uploads/product-feature-thumb/2020/09/05/4FJxoW83SQGLa4aFsRFysBnWVBsypQNMXMRp7K7w.jpeg', 'Wet n Wild Color Icon Eyeshadow 10 Pan Palette- Cosmic Collision', NULL, 0, 3, 2, NULL, 0, 0),
(262, 9, 16, 49, 30, 'Desktop Stationery Set - Red', 'desktop-stationery-set-red-lagmgw', 'uploads/product-feature/2020/09/06/S2AWqCI1UqSCd045vlklL2wdx3eOztpy658AhKUt.webp', '2020-09-07 00:24:25', '2020-09-27 17:31:21', 11, 58, NULL, NULL, NULL, NULL, NULL, '<p>Hearts Paper Stationery is a place of your feelings of happiness, sorrows, emotions and warmth. We want to accompany you in every moments, occasions, seasons, life events. We want to be a part of your feelings, your dreams. This clothing store offers you a piece of affection they give you the means to express your warmth to your near and dear ones.</p>', 'uploads/product-feature-rsz/2020/09/06/S2AWqCI1UqSCd045vlklL2wdx3eOztpy658AhKUt.webp', 'uploads/product-feature-thumb/2020/09/06/S2AWqCI1UqSCd045vlklL2wdx3eOztpy658AhKUt.webp', 'Size-29\" x 19.25\"\r\nPaper-80gsm art Paper\r\nMake your gift attractive by using cute wrapping paper\r\nSize: Standard Wrapping Paper size\r\nColor: Multi-color', NULL, 0, 3, 2, NULL, 0, 0),
