(415, 9, 16, 27, 10, 'Lifebuoy Soap Bar Care 100g', 'lifebuoy-soap-bar-care-100g-vxozjkm', 'uploads/product-feature/2020/09/26/JtykvKxkZ2JZiNXY0SfnYW9CmwepYpCF6fnYoc4J.jpeg', '2020-09-26 14:28:55', '2020-09-26 19:43:25', 11, 155, 354, NULL, NULL, NULL, NULL, '<h2>Product details of Lifebuoy Soap Bar Care 100g</h2><ul><li>Product Type: Soap Bar</li><li>Capacity: 100g</li><li>Brand: Lifebuoy</li></ul><h2><strong>About Unilever</strong></h2><p><br>Unilever is a Dutch-British transnational consumer goods company co-headquartered in Rotterdam, Netherlands and London, United Kingdom. Its products include food, beverages, cleaning agents and personal care products. It is the world\'s largest consumer goods company measured by 2012 revenue, Unilever is the world\'s largest producer of food spreads, such as margarine. Unilever is one of the oldest multinational companies; its products are available in around 190 countries.<br>Unilever owns over 400 brands, but focuses on thirteen brands with sales of over one billion euros: Axe/Lynx, Dove, Omo, Becel/Flora, Heart brand ice creams, Hellmann\'s, Knorr, Lipton, Lux, Magnum, Rama, Rexona, Sun silk and Surf.[6] It is a dual-listed company consisting of Unilever N.V., based in Rotterdam, and Unilever plc, based in London. The two companies operate as a single business, with a common board of directors. Unilever is organized into four main divisions â€“ Foods, Refreshment (beverages and ice cream), Home Care, and Personal Care. It has research and development facilities in the United Kingdom (two), the Netherlands, China, India and the United States.</p>', 'uploads/product-feature-rsz/2020/09/26/JtykvKxkZ2JZiNXY0SfnYW9CmwepYpCF6fnYoc4J.jpeg', 'uploads/product-feature-thumb/2020/09/26/JtykvKxkZ2JZiNXY0SfnYW9CmwepYpCF6fnYoc4J.jpeg', 'Whatâ€™s in the box: Lifebuoy Soap Bar Care 100g', NULL, 1, 3, 2, 2, 0, 0),
