(421, 9, 16, 47, 10, 'Dettol Soap Original 75gm Bathing Bar Soap', 'dettol-soap-original-75gm-bathing-bar-soap-vxolzow', 'uploads/product-feature/2020/09/28/YJzqzkhqcSMfuAXWv4LBGSRe3VVrQCLiEuJLzXyP.jpeg', '2020-09-26 15:02:59', '2020-09-28 15:56:56', 11, 155, 354, NULL, NULL, NULL, NULL, '<h2>Product details of Dettol Soap Original 75gm Bathing Bar Soap</h2><ul><li>Dettol Original Soap comes with the Classic Dettol fragrance</li><li>Dettol Original Soap protects from up to 100 illness causing germs</li><li>Dettol Original Soap is dermatologically tested for everyday use</li><li>Dettol Original Soap is a Grade 1 Soap- providing the best value for your purchase</li><li>Dettol Bar Soaps keeps you healthy and provides 100% better protection vs ordinary soaps</li><li>Dettol is recommended by the Doctors of Bangladesh Private Medical Practitioners Association (BPMPA)</li></ul><p>&nbsp;</p>', 'uploads/product-feature-rsz/2020/09/28/YJzqzkhqcSMfuAXWv4LBGSRe3VVrQCLiEuJLzXyP.jpeg', 'uploads/product-feature-thumb/2020/09/28/YJzqzkhqcSMfuAXWv4LBGSRe3VVrQCLiEuJLzXyP.jpeg', 'Use 75 gm bar of Dettol Original Soap to get the most cost-effective germ protection every day. Everyday protection against a wide range of unseen germs.', NULL, 1, 3, 2, 2, 0, 0),
(422, 9, 16, 47, 10, 'Dettol Soap Original Bathing Bar Soap 30gm', 'dettol-soap-original-bathing-bar-soap-30gm-vxojj8l', 'uploads/product-feature/2020/09/26/uALfJGQIIp4qZI5vBvZqzHgkhPeK3zl6JoFfEnW2.jpeg', '2020-09-26 15:32:27', '2020-09-26 19:41:29', 11, 155, 354, NULL, NULL, NULL, NULL, '<ul><li>Product Name: Dettol Soap Original Bathing Bar Soap 30gm</li><li>Size: 30gm</li><li>Use 30 gm bar of Dettol Original Soap to get the most cost-effective germ protection every day. Dettol Original soap is antibacterial which gives you protection from up to 100 illness-causing germs.</li><li>Dettol Original is a Grade 1 bathing soap- providing the best value for your purchase.</li><li>Thatâ€™s why mothers rely on Dettol protection.</li></ul>', 'uploads/product-feature-rsz/2020/09/26/uALfJGQIIp4qZI5vBvZqzHgkhPeK3zl6JoFfEnW2.jpeg', 'uploads/product-feature-thumb/2020/09/26/uALfJGQIIp4qZI5vBvZqzHgkhPeK3zl6JoFfEnW2.jpeg', 'Recommended by Doctors of Bangladesh Private Medical Practitioners Association (BPMPA).', NULL, 1, 3, 2, 2, 0, 0),
(423, 9, 16, 48, 10, 'Savlon Soap Cool 100gm', 'savlon-soap-cool-100gm-vxoeo1r', 'uploads/product-feature/2020/09/26/5KAMZBkUPbLAkYFhEhwuGsq4HuzieBxe5kNZ3ZZM.jpeg', '2020-09-26 16:05:09', '2020-09-26 19:41:11', 11, 155, 354, NULL, NULL, NULL, NULL, '<h2>Product details of Savlon Soap Cool 100gm</h2><ul><li>Product Type: Savlon Soap Cool</li><li>Capacity: 100gm</li><li>Brand: Savlon</li></ul><p>ACI was established as the subsidiary of Imperial Chemical Industries (ICI) in the then East Pakistan in 1968. After independence the company has been incorporated in Bangladesh on the 24th of January 1973 as ICI Bangladesh Manufacturers Limited and also as Public Limited Company. This Company also obtained listing with Dhaka Stock Exchange on 28 December, 1976 and its first trading of shares took place on 9 March, 1994. Later on 5 May, 1992, ICI plc divested 70% of its shareholding to local management. Subsequently the company was registered in the name of Advanced Chemical Industries Limited. Listing with Chittagong Stock Exchange was made on 22 October 1995. Advanced Chemical Industries (ACI) Limited is one of the leading conglomerates in Bangladesh, with a multinational heritage. The company has diversified into four major Strategic Business Units.</p><h2>&nbsp;</h2>', 'uploads/product-feature-rsz/2020/09/26/5KAMZBkUPbLAkYFhEhwuGsq4HuzieBxe5kNZ3ZZM.jpeg', 'uploads/product-feature-thumb/2020/09/26/5KAMZBkUPbLAkYFhEhwuGsq4HuzieBxe5kNZ3ZZM.jpeg', 'Whatâ€™s in the box: Savlon Soap Fresh 100gm', NULL, 1, 3, 2, 2, 0, 0),
