(425, 9, 16, 43, 52, 'Nestle NIDO FortiGrow Milk Powder Bib - 350g', 'nestle-nido-fortigrow-milk-powder-bib-350g-oz8dyzy', 'uploads/product-feature/2020/09/26/jKHQCFhPLsjtAqJRnta9OrOCDxLzmHjjaT6WxeyA.jpeg', '2020-09-26 19:32:28', '2020-09-26 19:40:31', 11, 120, 178, NULL, NULL, NULL, NULL, '<h2>Product details of Nestle NIDO FortiGrow Milk Powder Bib - 350g</h2><ul><li>Discount Vouchers not applicable for this product</li><li>Product Type: Milk Powder</li><li>Brand: Nestle</li><li>Capacity: 350g</li><li>Healthy Food</li><li>NIDO Fortigrow is the worldâ€™s number 1 selling milk powder.</li></ul><p>Nestle NIDO FortiGrow Milk Powder Bib - 350g</p>', 'uploads/product-feature-rsz/2020/09/26/jKHQCFhPLsjtAqJRnta9OrOCDxLzmHjjaT6WxeyA.jpeg', 'uploads/product-feature-thumb/2020/09/26/jKHQCFhPLsjtAqJRnta9OrOCDxLzmHjjaT6WxeyA.jpeg', 'Whatâ€™s in the box: Nestle NIDO FortiGrow Milk Powder Bib - 350g', NULL, 1, 3, 2, 2, 0, 0),
(426, 9, 16, 27, 10, 'Lifebuoy Hand wash Total Pump 200ml', 'lifebuoy-hand-wash-total-pump-200ml-vxogrgm', 'uploads/product-feature/2020/09/27/SV9hmepJNdF2RDUzU9t2rZBV2Bnolp55X2BWnwsl.jpeg', '2020-09-27 15:31:07', '2020-09-27 16:11:29', 11, 155, 357, NULL, NULL, NULL, NULL, '<h2>Product details of Lifebuoy Hand wash Total Pump 200ml</h2><ul><li>Product Type: Hand wash</li><li>Brand: Lifebuoy</li><li>Capacity: 200ml</li></ul><h2><strong>About Unilever</strong></h2><p><br>Unilever is a Dutch-British transnational consumer goods company co-headquartered in Rotterdam, Netherlands and London, United Kingdom. Its products include food, beverages, cleaning agents and personal care products. It is the world\'s largest consumer goods company measured by 2012 revenue, Unilever is the world\'s largest producer of food spreads, such as margarine. Unilever is one of the oldest multinational companies; its products are available in around 190 countries.<br>Unilever owns over 400 brands, but focuses on thirteen brands with sales of over one billion euros: Axe/Lynx, Dove, Omo, Becel/Flora, Heart brand ice creams, Hellmann\'s, Knorr, Lipton, Lux, Magnum, Rama, Rexona, Sunsilk and Surf.[6] It is a dual-listed company consisting of Unilever N.V., based in Rotterdam, and Unilever plc, based in London. The two companies operate as a single business, with a common board of directors. Unilever is organized into four main divisions â€“ Foods, Refreshment (beverages and ice cream), Home Care, and Personal Care. It has research and development facilities in the United Kingdom (two), the Netherlands, China, India and the United States.</p>', 'uploads/product-feature-rsz/2020/09/27/SV9hmepJNdF2RDUzU9t2rZBV2Bnolp55X2BWnwsl.jpeg', 'uploads/product-feature-thumb/2020/09/27/SV9hmepJNdF2RDUzU9t2rZBV2Bnolp55X2BWnwsl.jpeg', 'Whatâ€™s in the box: Lifebuoy Hand wash Total Pump 200ml', NULL, 1, 3, 2, 2, 0, 0),
(427, 9, 16, 27, 10, 'Lifebuoy Hand wash Total Refill Pack 170ml', 'lifebuoy-hand-wash-total-refill-pack-170ml-vxoklgd', 'uploads/product-feature/2020/09/27/VyX9LNzuQG6G6qxaZ1oJT9guKhubeio91Lxh722p.jpeg', '2020-09-27 15:37:57', '2020-09-27 16:11:25', 11, 155, 357, NULL, NULL, NULL, NULL, '<h2>Lifebuoy Hand wash Total Refill Pack 170ml</h2><p>&nbsp;</p><p>Lifebuoy Hand wash makes hand washing quicker and more effective than ever before! Lifebuoy Total 10 Germ Protection Hand Wash contains our patented ingredient, Active Natural Shield, ensuring your hands are clean and protected against germs. The special formula is proven to remove 99.9% of germs in just 10 seconds and designed to give you the protection you and your family need. The hand wash prevents the spread of germs, keeping the family safe from 10 infection-causing germs. It will leave your skin feeling protected, cleansed and refreshed.</p><p>Lifebuoy Hand Washes are approved by Royal Society of Public Health, London.</p><p>Usage directions for best results: Take a few drops of the hand wash, add water and rub the hands together to create foam and lather. Rub the back of your hands as well as your fingertips and nails. Rinse with water and dry with a clean cloth. The germs can be removed in just 10 seconds. As per lab test. Washing with soap &amp; water is a recommended measure to help prevent transmission of infection causing germs.</p><p>Our Story: Lifebuoy started with William Lever\'s goal to stop cholera in Victorian England. Over the past century, we\'ve evolved into the world\'s #1 selling germs protection soap and a worldwide leader bringing better health and hygiene to billions.</p>', 'uploads/product-feature-rsz/2020/09/27/VyX9LNzuQG6G6qxaZ1oJT9guKhubeio91Lxh722p.jpeg', 'uploads/product-feature-thumb/2020/09/27/VyX9LNzuQG6G6qxaZ1oJT9guKhubeio91Lxh722p.jpeg', 'Whatâ€™s in the box: Lifebuoy Hand wash Total Refill Pack 170ml', NULL, 1, 3, 2, 2, 0, 0),
