(440, 9, 16, 48, 10, 'Savlon Hand Sanitizer 50ml', 'savlon-hand-sanitizer-50ml-vx7vk2b', 'uploads/product-feature/2020/09/27/e8ucjGR1RvVhF1E1ZS8eKINfkaygdg58CmnFGKFV.jpeg', '2020-09-27 17:02:02', '2020-09-27 17:29:48', 11, 155, 357, NULL, NULL, NULL, NULL, '<h2>Product details of Savlon Hand Sanitizer 50ml</h2><ul><li>Product Type: Hand Sanitizer</li><li>Capacity: 50ml</li><li>Brand: ACI</li></ul><p>ACI was established as the subsidiary of Imperial Chemical Industries (ICI) in the then East Pakistan in 1968. After independence the company has been incorporated in Bangladesh on the 24th of January 1973 as ICI Bangladesh Manufacturers Limited and also as Public Limited Company. This Company also obtained listing with Dhaka Stock Exchange on 28 December, 1976 and its first trading of shares took place on 9 March, 1994. Later on 5 May, 1992, ICI plc divested 70% of its shareholding to local management. Subsequently the company was registered in the name of Advanced Chemical Industries Limited. Listing with Chittagong Stock Exchange was made on 22 October 1995. Advanced Chemical Industries (ACI) Limited is one of the leading conglomerates in Bangladesh, with a multinational heritage. The company has diversified into four major Strategic Business Units.</p>', 'uploads/product-feature-rsz/2020/09/27/e8ucjGR1RvVhF1E1ZS8eKINfkaygdg58CmnFGKFV.jpeg', 'uploads/product-feature-thumb/2020/09/27/e8ucjGR1RvVhF1E1ZS8eKINfkaygdg58CmnFGKFV.jpeg', 'Whatâ€™s in the box: Savlon Hand Sanitizer 50ml', NULL, 1, 3, 2, 2, 0, 0),
