(456, 9, 16, 48, 16, 'Savlon Cream 60 gm', 'savlon-cream-60-gm-3npey0', 'uploads/product-feature/2020/09/27/BNrOE19B6vEmpKH11TWTaqN1LPUTuyJOriCjUylj.jpeg', '2020-09-27 19:36:47', '2020-09-27 19:52:16', 11, 75, 40, NULL, NULL, NULL, NULL, '<h2>Product details of Savlon Cream 60 gm</h2><ul><li>Weight: 60gm</li><li>Product Type: Antiseptic Cream</li><li>Brand: Savlon</li><li>Essential household item</li><li>Great for everyday use</li></ul><p>ACI was established as the subsidiary of Imperial Chemical Industries (ICI) in the then East Pakistan in 1968. After independence the company has been incorporated in Bangladesh on the 24th of January 1973 as ICI Bangladesh Manufacturers Limited and also as Public Limited Company. This Company also obtained listing with Dhaka Stock Exchange on 28 December, 1976 and its first trading of shares took place on 9 March, 1994. Later on 5 May, 1992, ICI plc divested 70% of its shareholding to local management. Subsequently the company was registered in the name of Advanced Chemical Industries Limited. Listing with Chittagong Stock Exchange was made on 22 October 1995. Advanced Chemical Industries (ACI) Limited is one of the leading conglomerates in Bangladesh, with a multinational heritage. The company has diversified into four major Strategic Business Units.</p>', 'uploads/product-feature-rsz/2020/09/27/BNrOE19B6vEmpKH11TWTaqN1LPUTuyJOriCjUylj.jpeg', 'uploads/product-feature-thumb/2020/09/27/BNrOE19B6vEmpKH11TWTaqN1LPUTuyJOriCjUylj.jpeg', 'Whatâ€™s in the box: Savlon Cream 60 gm', NULL, 1, 3, 2, NULL, 0, 0),
(457, 1, 16, 49, 16, 'Neostrip Frist Aid Bandage - 100pcs', 'neostrip-frist-aid-bandage-100pcs-3npnwo', 'uploads/product-feature/2020/09/27/PZcXlVJG3c2KXZPXbHHY45uI1thdf3DgSdBoUNTY.jpeg', '2020-09-27 19:41:46', '2020-09-27 20:28:11', 11, 75, 37, NULL, NULL, NULL, NULL, '<h2>Product details of Neostrip Frist Aid Bandage - 100pcs</h2><ul><li>Call 9-1-1 or EMS if bleeding is severe and difficult to stop.</li><li>Have the casualty lie down, if possible.</li><li>Place a clean, sterile, cloth directly over the bleeding site. If available, Recuer should wear gloves to protect from Bloodborne Pathogens.</li><li>Firmly apply pressure to the wound using one or both hands. Apply a bandage to hold the first dressing in place.</li><li>Apply additional cloths or pads if bleeding continues. Do not remove the initial dressing as this will tear away the clotted blood and cause bleeding to start over.</li><li>Elevate the bleeding site above the heart level if bleeding is difficult to control with firm, direct pressure. Do not elevate the limb if you suspect the possibility of broken bones or head, neck or spinal injury.</li><li>Continue to apply direct, firm pressure to control bleeding until Emergency Medical Personnel arrive.</li><li>A tourniquet should be used only as a last resort and is not recommended unless the responder has specific training on how to use a tourniquet safety.</li><li>Do not give the casualty alcohol, caffeinated beverages, or aspirin.</li><li>Once the bleeding has been controlled:Continue to apply firm pressure to the injury site.</li><li>Keep the casualty warm by covering him/her with coats or blankets.</li><li>Do not move the casualty unless necessary.</li><li>If the casualty is conscious and asks for water, moisten her/his lips with a small amount of water. Do not give water to an unconscious casualty or if abdominal injury is suspected.</li></ul><h2><strong>About Neostrip Frist Aid Bandage</strong></h2><p>&nbsp;</p><ul><li>Provides extra flexibility Stretchable and comfortable fabric moves with you to fit better,</li><li>Flexible enough to move with you anywhere you go,</li><li>Ideal for bumps and scrapes,</li><li>Packaged for individual use and to replenish first aid stations and kits</li></ul>', 'uploads/product-feature-rsz/2020/09/27/PZcXlVJG3c2KXZPXbHHY45uI1thdf3DgSdBoUNTY.jpeg', 'uploads/product-feature-thumb/2020/09/27/PZcXlVJG3c2KXZPXbHHY45uI1thdf3DgSdBoUNTY.jpeg', 'Whatâ€™s in the box: Neostrip Frist Aid Bandage - 100pcs', NULL, 1, 2, 2, NULL, 0, 0),
