(465, 9, 16, 27, 52, 'Wheel Washing Powder 2in1 Clean & Fresh 1Kg', 'wheel-washing-powder-2in1-clean-fresh-1kg-bbalw83', 'uploads/product-feature/2020/09/27/t6CCLaxb068OEOsMZIVIoQ0c0n843mjsFUJHTAk4.jpeg', '2020-09-27 20:31:56', '2020-09-27 20:47:01', 11, 122, 200, NULL, NULL, NULL, NULL, '<h2>Product details of Wheel Washing Powder 2in1 Clean &amp; Fresh 1Kg</h2><ul><li>Product Type: Wheel Washing Powder 2in1 Clean &amp; Fresh</li><li>Brand: Unilever</li><li>Capacity: 1kg</li></ul><p>Unilever is a Dutch-British transnational consumer goods company co-headquartered in Rotterdam, Netherlands and London, United Kingdom. Its products include food, beverages, cleaning agents and personal care products. It is the world\'s largest consumer goods company measured by 2012 revenue, Unilever is the world\'s largest producer of food spreads, such as margarine. Unilever is one of the oldest multinational companies; its products are available in around 190 countries. Unilever owns over 400 brands, but focuses on thirteen brands with sales of over one billion euros: Axe/Lynx, Dove, Omo, Becel/Flora, Heart brand ice creams, Hellmann\'s, Knorr, Lipton, Lux, Magnum, Rama, Rexona, Sunsilk and Surf.[6] It is a dual-listed company consisting of Unilever N.V., based in Rotterdam, and Unilever plc, based in London. The two companies operate as a single business, with a common board of directors. Unilever is organized into four main divisions â€“ Foods, Refreshment (beverages and ice cream), Home Care, and Personal Care. It has research and development facilities in the United Kingdom (two), the Netherlands, China, India and the United States.</p>', 'uploads/product-feature-rsz/2020/09/27/t6CCLaxb068OEOsMZIVIoQ0c0n843mjsFUJHTAk4.jpeg', 'uploads/product-feature-thumb/2020/09/27/t6CCLaxb068OEOsMZIVIoQ0c0n843mjsFUJHTAk4.jpeg', 'Whatâ€™s in the box: Wheel Washing Powder 2in1 Clean & Fresh 1Kg', NULL, 1, 3, 2, NULL, 0, 0),
(466, 9, 16, 49, 52, 'Washing Powder Power Bright 1kg', 'washing-powder-power-bright-1kg-bbakodd', 'uploads/product-feature/2020/09/27/2RA3JL0avIXXvTV3BI2HUBY770KqtTYCTtCgfQcc.jpeg', '2020-09-27 20:36:07', '2020-09-27 20:46:57', 11, 122, 200, NULL, NULL, NULL, NULL, '<h2>Product details of Washing Powder Power Bright 1kg</h2><ul><li>Rin Washing Powder removes dirt from deep within the cloth fiber, thereby removing dullness from your clothes</li><li>Rin Washing Powder comes with Bright Clean Technology, making your clothes look \'Bright like new\'</li><li>Use 1 or 2 scoops of Rin for a bucket wash &amp; 2 or 3 scoops of Rin for machine wash</li><li>Your Rin Washing Powder is suitable for whites as well as color clothes</li><li>Keep your clothes shining \'Bright like new\' with Rin Washing Powder</li></ul><p>&nbsp;</p><ul><li>Rin Washing Powder removes dirt from deep within the cloth fiber, thereby removing dullness from your clothes</li><li>Rin Washing Powder comes with Bright Clean Technology, making your clothes look \'Bright like new\'</li><li>Use 1 or 2 scoops of Rin for a bucket wash &amp; 2 or 3 scoops of Rin for machine wash</li><li>Your Rin Washing Powder is suitable for whites as well as color clothes</li><li>Keep your clothes shining \'Bright like new\' with Rin Washing Powder</li></ul>', 'uploads/product-feature-rsz/2020/09/27/2RA3JL0avIXXvTV3BI2HUBY770KqtTYCTtCgfQcc.jpeg', 'uploads/product-feature-thumb/2020/09/27/2RA3JL0avIXXvTV3BI2HUBY770KqtTYCTtCgfQcc.jpeg', 'Whatâ€™s in the box: Washing Powder Power Bright 1kg', NULL, 1, 3, 2, NULL, 0, 0),
(467, 9, 16, 49, 52, 'Rin Washing Powder 500g', 'rin-washing-powder-500g-bbawx2a', 'uploads/product-feature/2020/09/27/KudovEhugyRFT0iSfeAFgRnTkaufkUyW0lazIr3G.jpeg', '2020-09-27 20:49:47', '2020-09-27 21:00:20', 11, 122, 200, NULL, NULL, NULL, NULL, '<h2>Product details of Rin Washing Powder 500g</h2><ul><li>Rin Washing Powder 500g removes dirt from deep within the cloth fiber, thereby removing dullness from your clothes</li><li>Rin Washing Powder comes with Bright Clean Technology, making your clothes look \'Bright like new\'</li><li>Use 1 or 2 scoops of Rin for a bucket wash &amp; 2 or 3 scoops of Rin for machine wash</li><li>Your Rin Washing Powder is suitable for whites as well as colored clothes</li><li>Keep your clothes shining \'Bright like new\' with Rin Washing Powder</li></ul><p>Rin Washing Powder removes dirt from deep within the cloth fiber, thereby removing dullness from your clothes. Rin Washing Powder comes with Bright Clean Technology, making your clothes look \'Bright like new\'. Use 1 or 2 scoops of Rin for a bucket wash &amp; 2 or 3 scoops of Rin for machine wash. Your Rin Washing Powder is suitable for whites as well as color clothes. Keep your clothes shining \'Bright like new\' with Rin Washing Powder. Rin believes that everyone is talented and it is the lack of opportunities that stand in the way. Rin believes that nothing should come in the way of your progress. Each one of you has the talent and deserves an opportunity to shine. Rin promises to make your clothes whiter and brighter, so that you can get the confidence to stride ahead on your journey to progress. Rin enables the people it serves, shine by giving them brighter cleaner clothes. The brand essence â€œDress to Progressâ€ captures the idea that bright clothes can help radiate confidence and open doors to progress. Buy Now!</p>', 'uploads/product-feature-rsz/2020/09/27/KudovEhugyRFT0iSfeAFgRnTkaufkUyW0lazIr3G.jpeg', 'uploads/product-feature-thumb/2020/09/27/KudovEhugyRFT0iSfeAFgRnTk