(468, 9, 16, 27, 52, 'Surf Excel Washing Powder 500g', 'surf-excel-washing-powder-500g-bbadayw', 'uploads/product-feature/2020/09/27/UaEmEKTQeZREuObOHqtIjCXrAOcEjwcB9Phq2VoD.jpeg', '2020-09-27 20:53:07', '2020-09-27 21:00:15', 11, 122, 200, NULL, NULL, NULL, NULL, '<h2>Product details of Surf Excel Washing Powder 500g</h2><ul><li>It\'s X-tra cleaning particles, combines the power of lemon&amp; bleach to make it a perfect wash</li><li>Removes various tough stains such as chocolate, oil, rasam, curry, soup, ketchup and beverages</li><li>For tough stains, pre-soak the garment in a solution of Surf excel Quick Wash for 30 mins</li><li>Hand-wash - Use 2 scoops of Surf excel Quick Wash ; Machine-wash - Use 3 scoops of Surf excel Quick Wash</li></ul><p>Surf excel Quick Wash detergent powder, a one stop solution for all your laundry woes.While learning new skills and having fun, children often come home with a variety of stains on their clothes and more so often on their very important uniforms. While youâ€™re happy that they have these new experiences, the stains leave you worried. To fight these difficult stains you end up putting in a lot extra effort and use additional stain removers such as bleach, lemon etc. Itâ€™s time you switch to Surf excel Quick Wash detergent powder and say goodbye to long laundry drills and juggling with different stain removal products each day. Surf excel Quick Wash is one of the premium most detergent powders available in Bangladesh and has X-Tra Clean particles that combine the power of different stain removing products such as lemon and bleach. The superior technology of Surf excel Quick Wash removes a variety of common tough stains like oil, ketchup, chocolate, curry stains, tea etc. With X-tra cleaning particles, it makes for the perfect wash. So go on and order your pack of Surf excel Quick Wash right away and let you kids gets out there, clean, smart and prepared to take on the world and leave the stains to us. Buy Now!</p>', 'uploads/