(470, 9, 16, 27, 52, 'Surf Excel Mini, 25gm', 'surf-excel-mini-25gm-bbwpvlr', 'uploads/product-feature/2020/09/27/s7pz6CuSkc5fx6LOzbahtPNOx9kqee2oqGZJGYXq.jpeg', '2020-09-27 20:59:38', '2020-09-27 21:00:09', 11, 122, 200, NULL, NULL, NULL, NULL, '<ul><li>Product Type: Detergent Powder</li><li>Brand: Surf Excel</li><li>Size: 25gm,&nbsp;Mini Pack</li><li>Surf Excel is one of the biggest Laundry product brands, worldwide.</li><li>Removes tough stains in just half the time</li><li>Great cleaning and multiple stain removal</li><li>Removes various stains like curry, mud, pickle, grease, and link.</li><li>With Fast Action Particles, it makes for the perfect wash</li></ul><p><strong>About the product:</strong></p><p>&nbsp;</p><ul><li>Surf Excel Easy wash has Fast Action Formula which dissolves in just a few seconds and works instantly to remove various tough stains such as chocolate, oil, rasam, curry, soup, ketchup, and beverages.</li><li>Moreover, now removing stains will take Half the time [50% less]. Get modern Surf Excel Easy wash and spend more time with your children</li></ul>', 'uploads/product-feature-rsz/2020/09/27/s7pz6CuSkc5fx6LOzbahtPNOx9kqee2oqGZJGYXq.jpeg', 'uploads/product-feature-thumb/2020/09/27/s7pz6CuSkc5fx6LOzbahtPNOx9kqee2oqGZJGYXq.jpeg', 'Product Type: Detergent Powder\r\nBrand: Surf Excel\r\nSize: 25gm, Mini Pack\r\nSurf Excel is one of the biggest Laundry product brands, worldwide.\r\nRemoves tough stains in just half the time', NULL, 1, 2, 2, NULL, 0, 0),
