(505, 9, 16, 177, 52, 'Teer Advanced Soyabean oil - 1 Litre', 'teer-advanced-soyabean-oil-1-litre-weoo6pg', 'uploads/product-feature/2020/09/28/vbLK0ApprTNoMifQoLHjrPF44PPi0PjZqoQ6oIEp.jpeg', '2020-09-28 17:08:11', '2020-09-28 17:24:15', 11, 121, 190, NULL, NULL, NULL, NULL, '<h2>Product details of Teer Advanced Soyabean oil - 1 Litre</h2><ul><li>Brand: Teer</li><li>Good for your heart</li><li>Excellent source of linoleic acid</li><li>Good Quality Product</li><li>100% Halal</li></ul><p>Groceries are not the distant shopping items any more! In this days of Online Revolution we can get different types of groceries items like Rice, Edible Oils, Noodles and Pastas, Cookies, Pastry Items, Chocolates, Tasty Sweet and Sour Pickles, Sugars, etc Open or Canned/Packed products just after doing some smart clicks online. Daraz brings to you almost every types of grocery and shopping items to your doorstep just upon your needs!<br><br><br>The seller, <strong>City Group</strong>, offers a wide selection of products in Bangladesh with a promise of fast, safe and easy online shopping experience through Daraz. The seller comes closer to the huge customers on this leading online shopping platform of all over Bangladesh and serving to the greater extent for achieving higher customer satisfaction. The brands working with Daraz are not only serving top class grocery products but also are dedicated to acquiring brand loyalty across the nation.</p>', 'uploads/product-feature-rsz/2020/09/28/vbLK0ApprTNoMifQoLHjrPF44PPi0PjZqoQ6oIEp.jpeg', 'uploads/product-feature-thumb/2020/09/28/vbLK0ApprTNoMifQoLHjrPF44PPi0PjZqoQ6oIEp.jpeg', 'Whatâ€™s in the box: Teer Advanced Soyabean oil - 1 Litre', NULL, 1, 3, 2, NULL, 0, 0),
(506, 9, 16, 100, 52, 'Fresh Soyabean Oil - 1Ltr', 'fresh-soyabean-oil-1ltr-weodgzl', 'uploads/product-feature/2020/09/28/YUjdcUad58FW0qr24Rmh67yojQTnX9YypWABhOzS.jpeg', '2020-09-28 17:16:23', '2020-09-28 17:24:10', 11, 121, 190, NULL, NULL, NULL, NULL, '<h2>Product details of Fresh Soyabean Oil - 1Ltr</h2><ul><li>Product Type: Oil</li><li>Brand: Fresh</li><li>Net Weight: 1ltr</li><li>Premium Quality Oil</li><li>Air Tight Container for Freshness</li><li>Produced by the Best Quality Machinery</li><li>Good for heart health</li></ul><h2>Fresh Soyabean Oil - 1Ltr</h2><p><br>Fresh Soyabean Oil is one of the widely consumed cooking oils in Bangladesh and its nutritional value is comparable to those of other vegetable oils like maize corn oil, groundnut oil, sunflower oil and safflower oil. It is an excellent source of linoleic acid, which is an essential fatty acid required by the body.<br><br><br><br>Fresh Soyabean Oil is a super pure, super fresh vegetable oil that follows 3 steps of refining process. After going through a five step deodorization process, the Soyabean oil also goes through degumming and neutralization stages, once that is complete the oil comes to a balanced de-colorized right oil ratio of Omega 3, 6 and intact Beta-carotene. It is a good source of healthy fats, omega-3 fatty acids and polyunsaturated fats. Fresh soyabean oil contain vitamin A and is fresh and healthy.</p>', 'uploads/product-feature-rsz/2020/09/28/YUjdcUad58FW0qr24Rmh67yojQTnX9YypWABhOzS.jpeg', 'uploads/product-feature-thumb/2020/09/28/YUjdcUad58FW0qr24Rmh67yojQTnX9YypWABhOzS.jpeg', 'Whatâ€™s in the box: Fresh Soyabean Oil - 1Ltr', NULL, 1, 3, 2, NULL, 0, 0),
(507, 9, 16, 100, 52, 'Fresh Soyabean Oil, 5 Liter', 'fresh-soyabean-oil-5-liter-wedkmdr', 'uploads/product-feature/2020/09/28/tsQnpBdhyww0dKWrICKus6UlmjH0ucvXHU4jGu4m.jpeg', '2020-09-28 17:23:28', '2020-09-28 17:24:03', 11, 121, 190, NULL, NULL, NULL, NULL, '<ul><li>Size: 5 Ltr</li><li>It follows 3 steps of refining process-Perfect Degumming &amp; Neutralization,</li><li>Balanced De-colorization and Five-step Deodorization to ensure right ratio of Omega 3 &amp; 6 and intact Beta-carotene in Soyabean Oil.</li></ul>', 'uploads/product-feature-rsz/2020/09/28/tsQnpBdhyww0dKWrICKus6UlmjH0ucvXHU4jGu4m.jpeg', 'uploads/product-feature-thumb/2020/09/28/tsQnpBdhyww0dKWrICKus6UlmjH0ucvXHU4jGu4m.jpeg', 'Brand: Fresh\r\nSize: 5 ltr\r\nType: Soybean Oil\r\nUnit of Measure: Piece', NULL, 1, 4, 2, NULL, 0, 0),
(508, 9, 16, 178, 52, 'Toilet Tissue Paper - White-1 Pack', 'toilet-tissue-paper-white-1-pack-box8z0w', 'uploads/product-feature/2020/09/28/NfmZReteSzXhmEKoOnPTvupv7Ag3vI3O6aTVyYs3.webp', '2020-09-28 17:25:34', '2020-09-28 17:31:33', 7, 122, 402, NULL, NULL, NULL, NULL, '<ul><li>Product Name: Toilet Tissue</li><li>Brand: Bashundhara</li><li>Chemical free</li><li>Environmentally friendly</li><li>Strong water absorbent</li><li>Pure and natural</li><li>Comfortable hand touch</li><li>lowest price</li></ul>', 'uploads/product-feature-rsz/2020/09/28/NfmZReteSzXhmEKoOnPTvupv7Ag3vI3O6aTVyYs3.webp', 'uploads/product-feature-thumb/2020/09/28/NfmZReteSzXhmEKoOnPTvupv7Ag3vI3O6aTVyYs3.webp', 'Toilet Tissue Paper - White-1 Pack', NULL, 1, 3, 2, NULL, 0, 0),
(509, 9, 16, 49, 52, 'Fortune Rice Bran Oil - 2Ltr', 'fortune-rice-bran-oil-2ltr-wede3nd', 'uploads/product-feature/2020/09/28/4hplHrVyUjksTdXXIGdjZ9rEjfEN0xLmaZ5VRO6w.jpeg', '2020-09-28 17:29:17', '2020-09-28 17:31:18', 11, 121, 190, NULL, NULL, NULL, NULL, '<h2>Product details of Fortune Rice Bran Oil - 2Ltr&nbsp;</h2><ul><li>Fortune Rice Bran Oil</li><li>Quantity: 2 Litre</li><li>Brand: Fortune</li><li>Very good bran oil for your health</li><li>Best Price</li><li>Good Quality</li></ul><p>Most researches show that for maximum health benefits daily 300mg Oryzanol is required by the body. An average Bangladeshi daily consumes about 33g edible ohs (12kg per year). To get 300mg Oryzanol from the daily oil consumption of 33g the oil must contain 910mg Oryzanol per 100g. That is why Fortune Rice Bran Health has been designed with 1000mg Oryzanol per 100g â€” so that sufficient Oryzanol is received by the body at normal levels of oil consumption.</p>', 'uploads/product-feature-rsz/2020/09/28/4hplHrVyUjksTdXXIGdjZ9rEjfEN0xLmaZ5VRO6w.jpeg', 'uploads/product-feature-thumb/2020/09/28/4hplHrVyUjksTdXXIGdjZ9rEjfEN0xLmaZ5VRO6w.jpeg', 'Whatâ€™s in the box: Fortune Rice Bran Oil - 2Ltr', NULL, 1, 3, 2, NULL, 0, 0),
(510, 9, 16, 49, 52, 'Fortune Fortified Rice Bran Oil 5 Liter', 'fortune-fortified-rice-bran-oil-5-liter-wedzxly', 'uploads/product-feature/2020/09/28/UK37pOm4r3cJMhJParVHzL3MAO8XIZkutpKbUFcj.jpeg', '2020-09-28 17:36:56', '2020-09-28 19:49:33', 11, 121, 190, NULL, NULL, NULL, NULL, '<h2><strong>Fortune Rice Bran Oil</strong></h2><p>Most researches show that for maximum health benefits daily 300mg Oryzanol is required by the body. An average Bangladeshi daily consumes about 33g edible ohs (12kg per year). To get 300mg Oryzanol from the daily oil consumption of 33g the oil must contain 910mg Oryzanol per 100g. That is why Fortune Rice Bran Health has been designed with 1000mg Oryzanol per 100g â€” so that sufficient Oryzanol is received by the body at normal levels of oil consumption.<br>&nbsp;</p><h2><strong>Presenting the 10 benefitsâ€™ that you can enjoy from Fortune rice bran health:</strong></h2><p><br>1. Decreases Cholesterol: Rice bran oil reduces blood triglycerides, which are the fat molecules in the blood. Low levels of triglycerides result in low levels of cholesterol.<br>2. Helps protect from heart diseases: Rice Bran oil is high in Oryzanol content This helps maintain HDL (Good cholesterol) and LDL (Bad cholesterol) in the blood which prevents heart diseases.<br>3. Helps clean blood vessels: MUFA(Mono-unsaturated Fatty Add) and PUFA( Polly unsaturated fatty adds) play an important role in lowering bad cholesterol. A balanced ratio of PUFA and MUFA in rice bran oil keeps the production of bad cholesterol in check, which keep blood vessels dean.<br>4. Provides balanced nutrition: The body requires two kinds of fatty acids- one that provides energy and the other that is required for biological processes. Rice bran oil contains a balanced proportion of both, that helps the body receive balanced nutrition.<br>5. Helps prevent cancer. Tocotrienols and Phytosterol are anti-mutagenic elements found in rice bran oil that help prevent cancer.<br>6. Helps to have better skin: Squalene is an organic compound naturally produced by human skin cells and is natural moisturizer. Rice bran oil contains good amounts of it which prevent ageing of the skin.<br>7. Makes nervous system healthier. Vitamin E is essential for normal neurological functioning. Rice bran oil is a good source of natural Vitamin E and thus helps in developing a healthier nervous system.<br>8. Enhances the immune system: Antioxidants improve health by fighting free radicals that harm the immune system. Rice bran oil has natural antioxidants that help build stronger immunity.<br>9. Helps develop better hormonal health: Ferulic acid^ contents in rice bran oil have been found to have good effects on the concentration of endocrine hormones.<br>10. Less-oily healthy food: Cooking oils become sticky due to oxidation during frying. But rice bran oil is highly stable which keeps it non-sticky and the food absorbs less oil.</p>', 'uploads/product-feature-rsz/2020/09/28/UK37pOm4r3cJMhJParVHzL3MAO8XIZkutpKbUFcj.jpeg', 'uploads/product-feature-thumb/2020/09/28/UK37pOm4r3cJMhJParVHzL3MAO8XIZkutpKbUFcj.jpeg', 'Whatâ€™s in the box: Fortune Fortified Rice Bran Oil 5lt', NULL, 1, 4, 2, NULL, 0, 0),
(511, 9, 16, 178, 52, 'Bashundhara Paper Napkin, 100 x 1 Ply', 'bashundhara-paper-napkin-100-x-1-ply-box4dyb', 'uploads/product-feature/2020/09/28/DdPHNUdPJnUYP6qPcvTs3Bf7vTqRrf8XTD0aVGt1.jpeg', '2020-09-28 17:39:39', '2020-09-28 19:49:27', 7, 122, 402, NULL, NULL, NULL, NULL, '<ul><li>Brand: Bashundhara</li><li>Product Type: Napkin</li><li>Quantity: 100&nbsp;x 1 ply</li><li>Basic Raw Material: 100% Virgin pulp</li><li>Color: White</li><li>Fragrance Status: Non-perfumed</li><li>GSM: 20.5</li><li>Size:&nbsp;13\"X13\"</li><li>Emboss: General Embossed</li></ul>', 'uploads/product-feature-rsz/2020/09/28/DdPHNUdPJnUYP6qPcvTs3Bf7vTqRrf8XTD0aVGt1.jpeg', 'uploads/product-feature-thumb/2020/09/28/DdPHNUdPJnUYP6qPcvTs3Bf7vTqRrf8XTD0aVGt1.jpeg', 'Bashundhara Paper Napkin, 100 x 1 Ply', NULL, 1, 2, 2, NULL, 0, 0);
