(543, 11, 16, 49, 52, 'Rupchanda Premium Aromatic Chinigura Rice - 1kg', 'rupchanda-premium-aromatic-chinigura-rice-1kg-weddwoy', 'uploads/product-feature/2020/09/28/SohfSWiC6dCdVIVLUkXzehNRDC9WWAi3OiPis4Fw.jpeg', '2020-09-28 21:29:14', '2020-09-28 21:29:41', 11, 121, 404, NULL, NULL, NULL, NULL, '<h2>Product details of Rupchanda Premium Aromatic Chinigura Rice - 1kg</h2><ul><li>Rupchanda Premium Aromatic Chinigura Rice</li><li>The Rice is found having lowest level of broken rice &amp; big grains</li><li>It ensures non-sticky &amp; perfect Polau for your meal.</li><li>This Quality Rice maintains the presence of broken rice &amp; big grains in a tolerance limit set by its own.</li></ul><h2><strong>Rupchanda Premium Aromatic Chinigura Rice</strong></h2><p><br>Everyone appreciates good quality rice, but to do that precisely, it is required to know the criteria that ensure the perceived quality of rice. Presence of broken rice &amp; big grains is two most important hindrances for a rice marketer to sustain quality. Rupchanda Premium Aromatic Chinigura Rice maintains the presence of broken rice &amp; big grains in a tolerance limit set by its own because there is no set guideline for rice quality in Bangladesh.<br>In BEOL lab, Rupchanda Premium Aromatic Chinigura is found having the lowest level of broken rice &amp; big grains, that ensures non-sticky &amp; perfect Polau.<br>&nbsp;</p><p><br>&nbsp;</p>', 'uploads/product-feature-rsz/2020/09/28/SohfSWiC6dCdVIVLUkXzehNRDC9WWAi3OiPis4Fw.jpeg', 'uploads/product-feature-thumb/2020/09/28/SohfSWiC6dCdVIVLUkXzehNRDC9WWAi3OiPis4Fw.jpeg', 'Whatâ€™s in the box: Premium Aromatic Chinigura Rice - 1kg', NULL, 1, 3, 2, NULL, 0, 0),
