(601, 9, 16, 47, 52, 'Dettol Antiseptic Disinfectant Liquid 500ml (Brown)', 'dettol-antiseptic-disinfectant-liquid-500ml-brown-bjpe69g', 'uploads/product-feature/2020/09/29/8NKjb5r9e7zVz2VGG6QwpgMCyfxue2L6vASgGsBF.jpeg', '2020-09-29 20:03:08', '2020-09-30 15:28:07', 11, 122, 198, NULL, NULL, NULL, NULL, '<h2>Product details of Dettol Antiseptic Disinfectant Liquid 500ml (Brown)</h2><ul><li>Dettol Antiseptic Liquid provides lab verified protection from 100 illness causing germs</li><li>Highly effective as First Aid which can be used for both Medical &amp; Personal Hygiene</li><li>Dettol Antiseptic Liquid removes germs from skin, safeguards from infections caused by cuts and scratches</li><li>Dettol Antiseptic Liquid can also be used as household disinfectant on home surface and in laundry</li><li>Dettol Antiseptic Liquid must be used as directed on the label for best protection</li><li>Recommended by Doctors of Bangladesh Private Medical Practitioners Association (BPMPA)</li></ul><p>Dettol Antiseptic Liquid can be used for household disinfectant (in laundry, on floors, surfaces, or lavatories). Do not use on the broken skin or wounds. Proven within 5 minutes of contact to kill a wide range of germs, including Bacteria &amp; fungi: E.coli, Salmonella, Listeria, Staph. aureus, E.hirae, Pseudomonas aeruginosa, Vibrio cholera, Candida albicans and Viruses: Influenza type A2, Herpes Simplex Virus Type 1. Recommended by Doctors of Bangladesh Private Medical Practitioners Association (BPMPA).</p>', 'uploads/product-feature-rsz/2020/09/29/8NKjb5r9e7zVz2VGG6QwpgMCyfxue2L6vASgGsBF.jpeg', 'uploads/product-feature-thumb/2020/09/29/8NKjb5r9e7zVz2VGG6QwpgMCyfxue2L6vASgGsBF.jpeg', 'Whatâ€™s in the box: Dettol Antiseptic Disinfectant Liquid 500ml (Brown)', NULL, 1, 3, 2, NULL, 0, 0),
