(653, 1, 16, 12, 6, 'Huggies Wonder Pants (Bubble Bed) L 32s (9-14 kg)', 'huggies-wonder-pants-bubble-bed-l-32s-9-14-kg-nn5egj', 'uploads/product-feature/2020/09/30/gYvI0gYeNmFWdAFkobICkhWho4l5jS5OLhiqDAiR.jpeg', '2020-09-30 19:23:17', '2020-09-30 20:00:56', 7, 18, NULL, NULL, NULL, NULL, NULL, '<h2>Product details of Huggies Wonder Pants (Bubble Bed) L 32s (9-14 kg)</h2><ul><li>The Bubble-BedTM is a 3-Dimensional layer</li><li>Feels like a soft &amp; fluffy bed against the babyâ€™s skin</li><li>Traps waste matter like urine and runny poo into the 3-Dimensional bubbles</li><li>Aids the waste matter to spread out evenly through the diaper and absorb into the core</li><li>Keeps the surface of the diaper unbelievably dry for your babyâ€™s delicate bottom</li><li>Ensuring that your baby remains happy and comfy, day and night!</li><li>Made in India</li></ul><p>This next generation diaper pant, the new Bubble wala Huggies, has been designed keeping the needs of parents in mind. As parents, you always want your babyâ€™s skin to be protected and comforted. The new Bubble-BedTM technology has been carefully designed to take care of your babyâ€™s tender &amp; delicate skin, like never before.</p><p>Youâ€™ve just delivered your little one and are ready to finally leave the hospital. Thatâ€™s happiness you just canâ€™t contain! Many new experiences and feelings await. And one of those new experiences, which may seem a little cumbersome sometimes, is diapering. Your baby spends a good part of their day in a diaper. Therefore, choosing the right diaper is extremely important. And this is where, we can do our part in making your motherhood journey more enjoyable.</p>', 'uploads/product-feature-rsz/2020/09/30/gYvI0gYeNmFWdAFkobICkhWho4l5jS5OLhiqDAiR.jpeg', 'uploads/product-feature-thumb/2020/09/30/gYvI0gYeNmFWdAFkobICkhWho4l5jS5OLhiqDAiR.jpeg', 'Whatâ€™s in the box: Huggies Wonder Pants (Bubble Bed) L 32s (9-14 kg)', NULL, 1, 3, 2, NULL, 0, 0),
(654, 1, 16, 12, 6, 'Huggies Dry Pant Diaper Large-50 Pcs (9-14 KG)', 'huggies-dry-pant-diaper-large-50-pcs-9-14-kg-nn5elj', 'uploads/product-feature/2020/09/30/gqq2XgqRfV6xeZ0hbXFC36NakMcv7hfEkKqKh9qL.jpeg', '2020-09-30 19:26:16', '2020-09-30 20:00:44', 7, 18, NULL, NULL, NULL, NULL, NULL, '<h2>Product details of Huggies Dry Pant Diaper Large-50 Pcs (9-14 KG)</h2><ul><li>Made in Malaysia</li><li>Pant Style Diaper</li><li>1,000 Fast Absorbing Micro Holes</li><li>5-Way Comfort Fit</li><li>Absorbs Up To 10 Hours</li><li>100% Breathable</li><li>Leak Guard</li><li>All Around Softness</li><li>New &amp; Improved! With 1,000 Micro Holes for faster absorbency</li><li>Clinically proven to help prevent diaper rash</li><li>Designed for Dryness &amp; Comfort Just like mums</li><li>At Huggies we believe that ensuring no harmful side effects is especially important when taking care of babyskin.</li><li>Baby skin is more delicate as it is 1/3 thinner than an adults, thus deserves the most natural care and protection from the risk of skin irritation.</li><li>Now let Huggies defend your baby\'s bottom, so you don\'t have to.</li></ul>', 'uploads/product-feature-rsz/2020/09/30/gqq2XgqRfV6xeZ0hbXFC36NakMcv7hfEkKqKh9qL.jpeg', 'uploads/product-feature-thumb/2020/09/30/gqq2XgqRfV6xeZ0hbXFC36NakMcv7hfEkKqKh9qL.jpeg', 'What\'s in the box: Huggies Dry Pant Diaper Large-50 Pcs (9-14 KG)', NULL, 1, 3, 2, NULL, 0, 0),
