(4, 'Customer Care', 'customer-care', '<p>1. Product return policy</p><p>2. Money Refund policy</p><p>4. warrenty policy</p><p>4. Safety measures for protection from corona</p><p>5. How can track your order process explanation</p><p>6. product service centre to repair product</p><p>7. Terms and condition&nbsp;</p>', '2020-09-02 18:52:47', '2020-09-02 18:58:43', '1'),
(5, 'Online Customer Service', 'online-customer-service', '<p>test</p>', '2020-09-02 19:00:38', '2020-09-02 19:00:38', '1'),
(6, 'Useful Information', 'useful-information', '<p>Online Shopping BD has never been easier. ANAZBD is best online shopping store in Bangladesh that features thousand products at affordable prices. As bangaldesh\'s online shopping landscape is expanding every year, online shopping in dhaka, chittagong, khulna, sylhet and other big cities are also gaining momentum. Anaz is among best websites for online shopping in bangladesh that promises fast, reliable and convenient delivery of products to your doorstep. Anaz being the trusted online shop in Bangladesh aims to provide a trouble-free shopping experience for the people of Bangladesh but is also providing ample opportunity for international online shopping from Bangladesh. Anaz aims to make online shopping accessible to all parts of the country.</p><p>Everyone is encouraged to shop with confidence at anazbd.com as our strict buyerâ€™s protection policies ensure no risks while shopping online.</p><p>Among tons of online stores in Bangladesh, Anaz aims to strictly adhere to international quality standards ensuring trust and reliability in customer service and originality in product delivery. Realizing the surge in ecommerce platform in bangladesh, Anaz aims to redefine online shopping experience with home delivery, cash on delivery and installment facility for shoppers across country. Our assortment includes 100% original products from leading electronics, fashion, beauty, and lifestyle brands. Especially for shoppers who do not have debit cards or credit cards, Anaz provides a facility of online shopping with cash on delivery to your home. To enhance your online shopping experience, we encourage you to download Anaz<a href=\"https://www.daraz.com.bd/mobile-apps/\">&nbsp;app</a> for Android &amp; IOS and have a taste of personalized shopping experience based on your interest and shopping needs.</p><p>&nbsp;</p><p>Online Shopping BD has never been easier. ANAZBD is best online shopping store in Bangladesh that features thousand products at affordable prices. As bangaldesh\'s online shopping landscape is expanding every year, online shopping in dhaka, chittagong, khulna, sylhet and other big cities are also gaining momentum. Anaz is among best websites for online shopping in bangladesh that promises fast, reliable and convenient delivery of products to your doorstep. Anaz being the trusted online shop in Bangladesh aims to provide a trouble-free shopping experience for the people of Bangladesh but is also providing ample opportunity for international online shopping from Bangladesh. Anaz aims to make online shopping accessible to all parts of the country.</p><p>Everyone is encouraged to shop with confidence at anazbd.com as our strict buyerâ€™s protection policies ensure no risks while shopping online.</p><p>Among tons of online stores in Bangladesh, Anaz aims to strictly adhere to international quality standards ensuring trust and reliability in customer service and originality in product delivery. Realizing the surge in ecommerce platform in bangladesh, Anaz aims to redefine online shopping experience with home delivery, cash on delivery and installment facility for shoppers across country. Our assortment includes 100% original products from leading electronics, fashion, beauty, and lifestyle brands. Especially for shoppers who do not have debit cards or credit cards, Anaz provides a facility of online shopping with cash on delivery to your home. To enhance your online shopping experience, we encourage you to download Anaz<a href=\"https://www.daraz.com.bd/mobile-apps/\">&nbsp;app</a> for Android &amp; IOS and have a taste of personalized shopping experience based on your interest and shopping needs.</p>', '2020-09-02 19:01:06', '2020-09-19 14:48:05', '1'),
