(11, 'Anaz Mall', 'anaz-mall', '<p>test</p>', '2020-09-02 19:03:57', '2020-09-02 19:03:57', '1'),
(12, 'Refund policy', 'refund-policy', '<p><strong>How to return your product?</strong></p><p>Please find below steps to know how to fill ORF and return related procedure:</p><p>1. Sign in to your Anaz&nbsp;Account, select My Orders.</p><p>2. Select the order you wish to return and click on the Manage Order button.</p><p>3. Click on Return Items.</p><p>4. Fill in the Return Form. The available return options (drop-off/pick-up) will be displayed in this form.</p><p>5. Pack your Anaz&nbsp;parcel securely, with the product in the original and undamaged manufacturer\'s packaging as delivered to you and print the Return Label.</p><p>If you are from inside Dhaka then print 1 copy of the return label &amp; secure the copy on the top of Anaz&nbsp;box &amp; if you are from outside Dhaka then print 2 copies of the return label and stick 1 copy on the top of Anaz&nbsp;box and also give a copy inside the Anaz box too.</p><p>6. If you selected Pick-up then you will be contacted within 72 hours of the return request. If you selected Drop off then you can drop it to your nearest drop off point within 3 working days from the return request.</p><p>If you do not get any drop off point from your area then you need to return that item via Sundarban Courier Service as per below address:</p><p>Ref:DBR00008931</p><p>To: Anaz BD (anaz.com)</p><p>Receiver Number: +8801958389013</p><p>Address: Office Address: KA/33, South Badda, Gulshan-1, Dhaka-1212, Cell- 01792024484</p><p>NOTE: As, the situation in our country is not stable due to the COVID-19. So you might experience delays in the return process. We seek your cooperation for the inconvenience and we are trying our best to process the return as soon as possible. Stay home and be safe.</p>', '2020-09-06 03:16:31', '2020-09-07 15:30:33', '2'),
(13, 'Return Policy', 'return-policy', '<h3>Returns Policy</h3><ol><li>If your product is defective / damaged or incorrect/incomplete at the time of delivery, please contact us within the applicable return window. Your product may be eligible for refund or replacement depending on the product category and condition. Please see the detailed terms in the relevant category below.</li><li>Please note that some products are not eligible for a return if the product is \"No longer needed\"</li><li>For device related issues after usage or the expiration of the return window, we will refer you to the brand warranty center (if applicable). For more information on warranty claims please view our<a href=\"https://pages.daraz.com.bd/wow/i/bd/help-pages/warranty-policy?hybrid=1\">&nbsp;Warranty Policy</a></li></ol><p>You will always find the relevant terms on the product page (Return Policy tab).</p><h3>Returns Policy per Category</h3><h4>Bags and Travel</h4><h4>Bedding &amp; Bath</h4><h4>Cameras</h4><h4>Computers &amp; Laptops</h4><h4>Digital Goods</h4><h4>Fashion</h4><h4>Furniture &amp; DÃ©cor</h4><h4>Groceries</h4><h4>Health &amp; Beauty</h4><h4>Home Appliances</h4><h4>Kitchen &amp; Dining</h4><h4>Laundry &amp; Cleaning</h4><h4>Media, Music &amp; Books</h4><h4>Mobiles &amp; Tablets</h4><h4>Mother &amp; Baby</h4><h4>Motors</h4><h4>Pet Supplies</h4><h4>Service Product</h4><h4>Special Digital Products</h4><h4>Sports &amp; Outdoors</h4><h4>Stationery &amp; Craft</h4><h4>Tools, DIY &amp; Outdoor</h4><h4>Toys &amp; Games</h4><h4>TV, Audio / Video, Gaming &amp; Wearables</h4><h4>Watches, Sunglasses and Jewellery</h4><p>Please note that certain items marked as non-returnable on product page are not eligible for return. For more information view the complete list of&nbsp;<a href=\"https://pages.daraz.com.bd/wow/i/bd/help-pages/non-returnable?hybrid=1\">non-returnable items</a>.</p><p>Please note that this policy does not apply to Daraz Global products.</p><h3>Valid reasons to return an item</h3><ol><li>Delivered Product is damaged (physically destroyed or broken) / defective (dead on arrival)</li><li>Delivered Product is incorrect (presentation different on website) / incomplete (missing parts)</li><li>Delivered Product is â€œNo longer neededâ€ (you no longer have a use for the product / you have changed your mind about the purchase / the size of a fashion product does not fit / you do not like the product after opening the package) - eligible for selected products only</li></ol><h4>Issuance of Refunds</h4><p>If your product is eligible for a refund, you can choose your preferred refund method based on the table below. The shipping fee is refunded along with the amount paid for your returned product.</p><p>The time required to complete a refund depends on the refund method you have selected. Once we have received your product (2-3 working days) and it has undergone a quality control (1-2 working days), the expected refund processing times are as follows:</p><p>Please note that this policy does not apply to Daraz Global products.</p><figure class=\"table\"><table><tbody><tr><td><strong>Payment Method</strong></td><td><strong>Refund Option</strong></td><td><strong>Refund Time</strong></td></tr><tr><td>All</td><td>Refund Voucher</td><td>1-2 working days</td></tr><tr><td>Debit or Credit Card</td><td>Debit or Credit Card Payment Reversal</td><td>9-10 working days</td></tr><tr><td>bKash</td><td>Bank Deposit / Mobile Payment Reversal</td><td>7 working days</td></tr><tr><td>Cash on Delivery (COD)</td><td>Bank Deposit</td><td>4-5 working days</td></tr><tr><td>Daraz Voucher</td><td>Refund Voucher</td><td>1-2 working days</td></tr></tbody></table></figure><p>Important Note: The Voucher discount code can only be applied once. The leftover amount will not be refunded or used for next purchase even if the value of order is smaller than voucher value.</p>', '2020-09-06 16:54:58', '2020-09-06 16:54:58', '2'),
(14, 'Warranty Policy', 'warranty-policy', '<h2><strong>Warranty Policy</strong></h2><h3>How do I know if my product has a warranty?</h3><p>If a warranty is offered on a product, the warranty period will be displayed on the product page, to the right of the product image below â€œDeliveryâ€.</p><p>If a product is sold by multiple vendors, the warranty period offered by each vendor will be displayed to the right of â€œSellerâ€ in the â€œSold by x more sellersâ€ box below the product image.</p><h3>Types of Warranties:</h3><p><strong>1.Brand Warranty:</strong>&nbsp;This limited warranty will apply to the products. For product defects under normal use circumstances and at the discretion of the company, Brand will provide free of charge repair and/or replacement services within the warranty period. Anaz will not take any responsibility for the after-sale services.</p><p><strong>2.Service warranty:</strong>&nbsp;Anaz will take the responsibility to get the product serviced from the vendor or customer may visit the vendor directly as well with the invoice paper to claim the warranty. Please note if any part of the product needs to be replaced for repairing under this warranty policy, customer will have to pay for that part.</p><p><strong>Violations against warranty, including but not limited to customer induced damage, such as self-repairs, broken display, bending, scratch, dent, burn, soaked or liquid damage, root or manual update, failure to comply with product manual, and so on.</strong></p><p>&nbsp;</p><h3>How do I claim my warranty ?</h3><p>&nbsp;</p><p>If it has been&nbsp;<strong>less than 7 days since delivery:</strong></p><p>You may be able to return your product without using a warranty. Call 16492 to lodge a return request. See our&nbsp;<a href=\"https://pages.daraz.com.bd/wow/i/bd/help-pages/how-to-return?hybrid=1\">Return policy</a>&nbsp;for detailed information.</p><p>&nbsp;</p><p>If it has been&nbsp;<strong>more than 7 days since delivery and the product has a warranty:</strong></p><p>Please contact the service center listed on the warranty card included with your product or call Anaz and we will provide the contact for you.</p><p>&nbsp;</p><p>If it has been&nbsp;<strong>more than 7 days since delivery and the product has no warranty:</strong></p><p>Unfortunately Anaz will be unable to cover the item and you will be responsible for repairing costs.</p><p>Have additional questions? Please email us at&nbsp;<a href=\"mailto:customer.bd@care.daraz.com\">customercare@anazbd.com</a>&nbsp;for more information</p><h3>How can I get my product serviced?</h3><p>If you bought a product that is eligible for servicing, please send the product(s) directly to the Service Center indicated on the warranty card included with your product. If there is no warranty card, please check the user manual or product packaging for more details.</p><p>For a prompt warranty claim kindly include all the accessories, information included in packaging and proof of purchase from Anaz(invoice).</p><p><br><br>&nbsp;</p><h3>Where are the Service Centers?</h3><p>Please refer to the manufacturer (or service center) details on the warranty card included with your product or go to you product page on Anazbd.com and look for warranty / service center information in the â€˜description â€˜ tab.</p><p>If there is no warranty card, please check the user manual or product packaging for more details.</p><p><br><br>&nbsp;</p><h3>Do I need to pay for repairs?</h3><p>If your product is within the warranty duration and is damaged by mechanical or electrical systems, you don\'t have to worry about the repairing cost. You will be covered.</p><p>If your product is past the warranty duration or is physically damaged, you will be responsible for the repair cost. We suggest you to repair the product at the service center authorized by the manufacturer (the warranty center on your warranty card) for better quality services.</p><p>&nbsp;</p><p>&nbsp;</p><h2>Warranty Policy</h2><h3>How do I know if my product has a warranty?</h3><p>If a warranty is offered on a product, the warranty period will be displayed on the product page, to the right of the product image below â€œDeliveryâ€.</p><p>If a product is sold by multiple vendors, the warranty period offered by each vendor will be displayed to the right of â€œSellerâ€ in the â€œSold by x more sellersâ€ box below the product image.</p><h3>Types of Warranties:</h3><p><strong>1.Brand Warranty:</strong>&nbsp;This limited warranty will apply to the products. For product defects under normal use circumstances and at the discretion of the company, Brand will provide free of charge repair and/or replacement services within the warranty period. Anaz will not take any responsibility for the after-sale services.</p><p><strong>2.Service warranty:</strong>&nbsp;Anaz will take the responsibility to get the product serviced from the vendor or customer may visit the vendor directly as well with the invoice paper to claim the warranty. Please note if any part of the product needs to be replaced for repairing under this warranty policy, customer will have to pay for that part.</p><p><br><br>&nbsp;</p><p><strong>Violations against warranty, including but not limited to customer induced damage, such as self-repairs, broken display, bending, scratch, dent, burn, soaked or liquid damage, root or manual update, failure to comply with product manual, and so on.</strong></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><h3>How do I claim my warranty ?</h3><p>&nbsp;</p><p>If it has been&nbsp;<strong>less than 7 days since delivery:</strong></p><p>You may be able to return your product without using a warranty. Call 16492 to lodge a return request. See our&nbsp;<a href=\"https://pages.daraz.com.bd/wow/i/bd/help-pages/how-to-return?hybrid=1\">Return policy</a>&nbsp;for detailed information.</p><p>&nbsp;</p><p>If it has been&nbsp;<strong>more than 7 days since delivery and the product has a warranty:</strong></p><p>Please contact the service center listed on the warranty card included with your product or call Anaz and we will provide the contact for you.</p><p>&nbsp;</p><p>If it has been&nbsp;<strong>more than 7 days since delivery and the product has no warranty:</strong></p><p>Unfortunately Anaz will be unable to cover the item and you will be responsible for repairing costs.</p>', '2020-09-06 17:02:13', '2020-09-06 17:02:13', '2');
