roducts on the Site shall be a strictly bipartite contract between you and the sellers on our Site while the payment processing occurs between you, the service provider and in case of prepayments with electronic cards your issuer bank. Accordingly, the contract of payment on the Site shall be strictly a bipartite contract between you and the service provider as listed on our Site.</p><p><a href=\"https://www.daraz.com.bd/wow/i/bd/help-pages/terms-and-conditions/?spm=a2a0e.14068718.footer_top.14.841bef46n6wdW3&amp;scm=1003.4.icms-zebra-100022982-2888463.OTHER_5476361488_2538033#terms\">Back to Top</a><br><br><br>&nbsp;</p><h4>D. CONTINUED AVAILABILITY OF THE SITE</h4><p>We will do our utmost to ensure that access to the Site is consistently available and is uninterrupted and error-free. However, due to the nature of the Internet and the nature of the Site, this cannot be guaranteed. Additionally, your access to the Site may also be occasionally suspended or restricted to allow for repairs, maintenance, or the introduction of new facilities or services at any time without prior notice. We will attempt to limit the frequency and duration of any such suspension or restriction.</p><p><a href=\"https://www.daraz.com.bd/wow/i/bd/help-pages/terms-and-conditions/?spm=a2a0e.14068718.footer_top.14.841bef46n6wdW3&amp;scm=1003.4.icms-zebra-100022982-2888463.OTHER_5476361488_2538033#terms\">Back to Top</a><br><br><br>&nbsp;</p><h4>E. LICENSE TO ACCESS THE SITE</h4><p>We require that by accessing the Site, you confirm that you can form legally binding contracts and therefore you confirm that you are at least 18 years of age or are accessing the Site under the supervision of a parent or legal guardian. We grant you a non-transferable, revocable and non-exclusive license to use the Site, in accordance with the Terms and Conditions described herein, for the purposes of shopping for personal items and services as listed to be sold on the Site. Commercial use or use on behalf of any third party is prohibited, except as explicitly permitted by us in advance. If you are registering as a business entity, you represent that you have the authority to bind that entity to this User Agreement and that you and the business entity will comply with all applicable laws relating to online trading. No person or business entity may register as a member of the Site more than once. Any breach of these Terms and Conditions shall result in the immediate revocation of the license granted in this paragraph without notice to you.<br><br>Content provided on this Site is solely for informational purposes. Product representations including price, available stock, features, add-ons and any other details as expressed on this Site are the responsibility of the vendors displaying them and is not guaranteed as completely accurate by us. Submissions or opinions expressed on this Site are those of the individual(s) posting such content and may not reflect our opinions.<br><br>We grant you a limited license to access and make personal use of this Site, but not to download (excluding page caches) or modify the Site or any portion of it in any manner. This license does not include any resale or commercial use of this Site or its contents; any collection and use of any product listings, descriptions, or prices; any derivative use of this Site or its contents; any downloading or copying of account information for the benefit of another seller; or any use of data mining, robots, or similar data gathering and extraction tools.<br><br>This Site or any portion of it (including but not limited to any copyrighted material, trademarks, or other proprietary information) may not be reproduced, duplicated, copied, sold, resold, visited, distributed or otherwise exploited for any commercial purpose without express written consent by us as may be applicable.<br><br>You may not frame or use framing techniques to enclose any trademark, logo, or other proprietary information (including images, text, page layout, or form) without our express written consent. You may not use any meta tags or any other text utilizing our name or trademark without our express written consent, as applicable. Any unauthorized use terminates the permission or license granted by us to you for access to the Site with no prior notice. You may not use our logo or other proprietary graphic or trademark as part of an external link for commercial or other purposes without our express written consent, as may be applicable.<br><br>You agree and undertake not to perform restricted activities listed within this section; undertaking these activities will result in an immediate cancellation of your account, services, reviews, orders or any existing incomplete transaction with us and in severe cases may also result in legal action:<br><br>&nbsp;</p><ul><li>Refusal to comply with the Terms and Conditions described herein or any other guidelines and policies related to the use of the Site as available on the Site at all times.</li><li>Impersonate any person or entity or to falsely state or otherwise misrepresent your affiliation with any person or entity.</li><li>Use the Site for illegal purposes.</li><li>Attempt to gain unauthorized access to or otherwise interfere or disrupt other computer systems or networks connected to the Platform or Services.</li><li>Interfere with anotherâ€™s utilization and enjoyment of the Site;</li><li>Post, promote or transmit through the Site any prohibited materials as deemed illegal by The People\'s Republic of Bangladesh.</li><li>Use or upload, in any way, any software or material that contains, or which you have reason to suspect that contains, viruses, damaging components, malicious code or harmful components which may impair or corrupt the Siteâ€™s data or damage or interfere with the operation of another Customerâ€™s computer or mobile device or the Site and use the Site other than in conformance with the acceptable use policies of any connected computer networks, any applicable Internet standards and any other applicable laws.</li></ul><p><a href=\"https://www.daraz.com.bd/wow/i/bd/help-pages/terms-and-conditions/?spm=a2a0e.14068718.footer_top.14.841bef46n6wdW3&amp;scm=1003.4.icms-zebra-100022982-2888463.OTHER_5476361488_2538033#terms\">Back to Top</a><br><br><br>&nbsp;</p><h4>F. YOUR CONDUCT</h4><p>You must not use the website in any way that causes, or is likely to cause, the Site or access to it to be interrupted, damaged or impaired in any way. You must not engage in activities that could harm or potentially harm the Site, its employees, officers, representatives, stakeholders or any other party directly or indirectly associated with the Site or access to it to be interrupted, damaged or impaired in any way. You understand that you, and not us, are responsible for all electronic communications and content sent from your computer to us and you must use the Site for lawful purposes only. You are strictly prohibited from using the Site<br><br>&nbsp;</p><p>Â·&nbsp; for fraudulent purposes, or in connection with a criminal offense or other unlawful activity</p><p>Â·&nbsp; to send, use or reuse any material that does not belong to you; or is illegal, offensive (including but not limited to material that is sexually explicit content or which promotes racism, bigotry, hatred or physical harm), deceptive, misleading, abusive, indecent, harassing, blasphemous, defamatory, libellous, obscene, pornographic, paedophilic or menacing; ethnically objectionable, disparaging or in breach of copyright, trademark, confidentiality, privacy or any other proprietary information or right; or is otherwise injurious to third parties; or relates to or promotes money laundering or gambling; or is harmful to minors in any way; or impersonates another person; or threatens the unity, integrity, security or sovereignty of Bangladesh or friendly relations with foreign States; or objectionable or otherwise unlawful in any manner whatsoever; or which consists of or contains software viruses, political campaigning, commercial solicitation, chain letters, mass mailings or any \"spamâ€</p><p>Â·&nbsp; Use the Site for illegal purposes.</p><p>Â·&nbsp; to cause annoyance, inconvenience or needless anxiety</p><p>Â·&nbsp; for any other purposes that is other than what is intended by us</p><p><a href=\"https://www.daraz.com.bd/wow/i/bd/help-pages/terms-and-conditions/?spm=a2a0e.14068718.footer_top.14.841bef46n6wdW3&amp;scm=1003.4.icms-zebra-100022982-2888463.OTHER_5476361488_2538033#terms\">Back to Top</a><br><br><br>&nbsp;</p><h4>G. YOUR SUBMISSION</h4><p>Anything that you submit to the Site and/or provide to us, including but not limited to, questions, reviews, comments, and suggestions (collectively, \"Submissions\") will become our sole and exclusive property and shall not be returned to you. In addition to the rights applicable to any Submission, when you post comments or reviews to the Site, you also grant us the right to use the name that you submit, in connection with such review, comment, or other content. You shall not use a false e-mail address, pretend to be someone other than yourself or otherwise mislead us or third parties as to the origin of any Submissions. We may, but shall not be obligated to, remove or edit any Submissions without any notice or legal course applicable to us in this regard.</p><p><a href=\"https://www.daraz.com.bd/wow/i/bd/help-pages/terms-and-conditions/?spm=a2a0e.14068718.footer_top.14.841bef46n6wdW3&amp;scm=1003.4.icms-zebra-100022982-2888463.OTHER_5476361488_2538033#terms\">Back to Top</a><br><br>&nbsp;</p><h4>H. CLAIMS AGAINST OBJECTIONABLE CONTENT</h4><p>We list thousands of products for sale offered by numerous sellers on the Site and host multiple comments on listings, it is not possible for us to be aware of the contents of each product listed for sale, or each comment or review that is displayed. Accordingly, we operate on a \"claim, review and takedown\" basis. If you believe that any content on the Site is illegal, offensive (including but not limited to material that is sexually explicit content or which promotes racism, bigotry, hatred or physical harm), deceptive, misleading, abusive, indecent, harassing, blasphemous, defamatory, libellous, obscene, pornographic, paedophilic or menacing; ethnically objectionable, disparaging; or is otherwise injurious to third parties; or relates to or promotes money laundering or gambling; or is harmful to minors in any way; or impersonates another person; or threatens the unity, integrity, security or sovereignty of Bangladesh or friendly relations with foreign States; or objectionable or otherwise unlawful in any manner whatsoever; or which consists of or contains software viruses, (\" objectionable content \"), please notify us immediately by following by writing to us on Anazbd.com. We will make all practical endeavours to investigate and remove valid objectionable content complained about within a reasonable amount of time.<br><br>Please ensure to provide your name, address, contact information and as many relevant details of the claim including name of objectionable content party, instances of objection, proof of objection amongst other. Please note that providing incomplete details will render your claim invalid and unusable for legal purposes.</p><p><a href=\"https://www.daraz.com.bd/wow/i/bd/help-pages/terms-and-conditions/?spm=a2a0e.14068718.footer_top.14.841bef46n6wdW3&amp;scm=1003.4.icms-zebra-100022982-2888463.OTHER_5476361488_2538033#terms\">Back to Top</a><br><br><br>&nbsp;</p><h4>I. CLAIMS AGAINST INFRINGING CONTENT</h4><p>We respect the intellectual property of others. If you believe that your intellectual property rights have been used in a way that gives rise to concerns of infringement, please write to us at Anazbd.com and we will make all reasonable efforts to address your concern within a reasonable amount of time. Please ensure to provide your name, address, contact informat