(1, 'Anazbd', NULL, 'Dhaka', 'iftekheralam@anazbd.com', '01792024484', '2020-08-06 18:13:28', '2020-09-17 19:38:02', 'Returns Policy\r\n1.	If your product is defective / damaged or incorrect/incomplete at the time of delivery, please contact us within the applicable return window. Your product may be eligible', 'Return & Refund Policy', '<p>\r\n  </p><div class=\"drz-footer-width-50 drz-footer-left\">\r\n    \r\n      <div class=\"drz-footer-about\">\r\n        \r\n          <h1 class=\"drz-footer-title\">Experience Personalized Online Shopping in Bangladesh with ANAZBD.com</h1>\r\n        \r\n      </div>\r\n    \r\n      <div class=\"drz-footer-about\">\r\n        \r\n          <p class=\"particle\">Online Shopping BD has never been easier. ANAZBD is best online shopping store in Bangladesh that features thousand products at affordable prices. As bangaldesh\'s online \r\nshopping landscape is expanding every year, online shopping in dhaka, \r\nchittagong, khulna, sylhet and other big cities are also gaining \r\nmomentum. Anaz is among best websites for online shopping in bangladesh\r\n that promises fast, reliable and convenient delivery of products to \r\nyour doorstep. Anaz being the trusted online shop in Bangladesh aims to\r\n provide a trouble-free shopping experience for the people of Bangladesh\r\n but is also providing ample opportunity for international online \r\nshopping from Bangladesh. Anaz aims to make online shopping accessible \r\nto all parts of the country.</p>\r\n        \r\n      </div>\r\n    \r\n      <div class=\"drz-footer-about\">\r\n        \r\n          <p class=\"particle\">Everyone is encouraged to shop with \r\nconfidence at anazbd.com as our strict buyerâ€™s protection policies \r\nensure no risks while shopping online.</p>\r\n        \r\n      </div>\r\n    \r\n      <div class=\"drz-footer-about\">\r\n        \r\n          <p class=\"particle\">Among tons of online stores in Bangladesh, Anaz aims to strictly adhere to international